import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
        <img src="../logo.jpg" alt="logo"/>
        <ul className="header">
          <li><a href="/">Strona główna</a></li>
          <li><a href="/about">O nas</a></li>
          <li><a href="/contact">Kontakt</a></li>
        </ul>
        <div className="content"></div>
      </div>
    );
  }
}

export default App;
